INSERT INTO `events` (`event_num`, `project_title`, `date`, `enddate`, `venue`, `event_description`, `event_details`, `status`) VALUES
('2014-001', 'Membership Registration', 'July 01, 2014', 'August 01, 2014', 'N/A', 'Registration of members of MathSoc for the year.', 'The Mathematics Society conducted a membership registration for every students taking up math subjects to gather income for the upcoming project’s expenses. The Mathematics Society gathered P7,415.00 from 1483  registered students from different colleges and courses. \r\n\r\nAs a token, the Mathematics Society distributed a logo sticker of the organization to each registered member.\r\n', 'UPCOMING'),
('2014-002', 'Inter-College MathWiz Challenge (Elimination round)', 'August 01, 2014', 'August 31, 2014', 'College of Science, Room 318', 'A Quiz Bee among MathSoc members.', 'The Mathematics Society of the Technological University of the Philippines conducted the elimination round of its annual Inter-College Competition, which, in this year, was entitled “Inter-College MathWiz Challenge”. It was aimed to choose the fifteen students who will score highest on the 50-item exam that was given. First year and second year students from different colleges were allowed to register with the fee of five pesos. Fifty-six students joined and the fifteen students qualified to ascend to the final round, namely, were (arranged in no particular order):\r\n\r\n1. Abayon, Juvin J.		BSCE-2A\r\n2. Balaton, Rommel M. 		BSME-2A\r\n3. Bandilla, Paul O.		BSME-2A\r\n4. Bartolome, Kevin C.		BSME-2A\r\n5. Bernacer, Mikee E.		BSCE-1E\r\n6. Cabrales, Daniel D.		BSESE-1E\r\n7. Coros, Ronals Allan A.	BTMT-2A\r\n8. Embudo, Thrina Rose		BSESE-2C\r\n9. Montante, Melvin C.		BSME-2A\r\n10. Nuñez, Neil Ryan T.		BSME-1C\r\n11. Omlang, John Nico N.	BSME-2A\r\n12. Ortazo, Ron Louise A.	BSME-1C\r\n13. Policarpio, Arthur T. 	BSCS-2B\r\n14. Quito, Gian Carlo R.	BSEE-1D\r\n15. Tenerife, Darren M.		BSME-2A\r\n', 'DONE'),
('2014-003', 'Inter-College MathWiz Challenge (Final round)', 'November 22, 2016', 'November 22, 2016', 'Integrated Research and Training Center (IRTC) Conference Room', 'dfdofe', 'The qualified contestants battled against each other to rank within the top three. From the fifteen students in the elimination round, only fourteen students participated. The judges in the said competition were Prof. Hasmin Ignacio, Prof. Cleopatria Bernardo and Prof.ElvaminBalog andthe quiz master was Prof. Maria Emelinade Lima. \r\nThe competition was divided into three parts; easy, average and difficult. Only five contestants remained in the difficult round and from there, the three competitors who scored highest were awarded. The top two contestants were the ones who represented the school in the inter-university competition. JuvinAbayon, who got first place, and Daniel Cabrales, who got the second place, received a cash prize of P3,000 with gold medal and P2,000 with silver medal respectively. The third placer, John NicoOmlang, received P1,000 cash prize with a bronze medal.\r\n', 'DONE'),
('2014-004', 'Inter-University MathWiz Challenge', 'February 21, 2013', 'February 21, 2013', 'Integrated Research and Training Center (IRTC) Conference Room', 'fddfdfd', 'The Inter-University MathWiz Challengewas held as part of the College of Science (COS) Week. The organization invited several schools to participate with only one team, composed of two first year or second year students, together with a coach.The following list shows the participating schools and their teams.\r\nThe questions given in the competition were prepared by the judges, Mr. John Irish Lira from San Sebastian College and Mr. JericksonOyco, an engineer at Globe Telecom. Similar to the inter-college competition, this contest was divided into three parts; the elimination round, semi-final round and the final round.\r\nIn the elimination round, seven teams were able to qualify to the next round, namely (arranged from highest rank to the lowest): Adamson University, Pamantasan ng Lungsod ng Valenzuela,  Pamantasan ng Lungsod ng Maynila, TUP-Manila, FEU-East Asia College, TUP-Cavite and Mapua Institute of Technology\r\nIn the semi-final round, another three teams didn’t qualify – the Mapua Institute of Technology, Pamantasan ng Lungsod ng Valenzuela, and TUP-Cavite. In the end, the remaining four teams fought competitively until the winners were declared. TUP-Manila, the team who scored highest, received P5,000 with gold medals, trophy and certificates of participation. \r\nOn the other hand FEU-East Asia College, the first runner-up, received silver medals, certificates of participation and a trophy, together with the cash prize worth P4000. Bronze medals, certificates of participation, trophy and P3000 were also given to Pamantasan ng Lungsod ng Maynila, the second runner-up. And the Adamson University ranked as the third runner-up, who received a P2000 cash prize and certificates of participation.\r\n', 'DONE'),
('2014-005', 'MathSwerte Raffle', 'February 21, 2013', 'February 27, 2013', 'Integrated Research and Training Center (IRTC) Conference Room', 'krrek', 'This event was held together with the Inter-University MathWiz Challenge. The raffle was drawn after the intermission numbers between each round in the competition. Everyone, inside or outside the university were allowed to buy raffle tickets. All in all, there were 24 winners of the following prizes:\r\n• ASUS Tab\r\n• Alcatel Android Phone \r\n• Tattoo Pocket Wifi \r\n• Casio 991ES Plus Scientific Calculator\r\n• 20 SanDisk Flashdrives\r\n\r\nList of the winners of the Mathswerte Raffle\r\nFirst Prize 			\r\nElgen Rose Sabardan\r\nSecond Prize  		\r\nJossel Ganalon\r\nThird Prize			\r\nLovely Serrano\r\nFourth Prize		\r\nKraven Villapando\r\nConsolation Prizes		\r\nAljohn Calapati\r\nAmado dela Torre\r\nAngelo Carlo Atis\r\nAngelo Paulo Cancino\r\nChloieToquero\r\nChristopher Gevale\r\nDannahOcava\r\nDenzel Leoncio\r\nFelicito Mangao\r\nIlhieLayco		\r\nJerricSubaldo\r\nJesselRebillon\r\nJoseph Gabilo\r\nJoshua Fernando\r\nMa.AdelfaRaveche\r\nRan David Zamora\r\nRandolph John Martinez\r\nRhon Jacob Casem\r\nRichard Agdeppa\r\nWellanie Molino', 'CANCELLED'),
